create table public.travel_offers (
  id serial not null,
  title text not null,
  description text not null,
  destination text not null,
  duration_days integer not null,
  price numeric(10, 2) not null,
  departure_location text not null,
  departure_date date null,
  return_date date null,
  image text null,
  gallery_images jsonb null default '[]'::jsonb,
  inclusions jsonb null default '[]'::jsonb,
  exclusions jsonb null default '[]'::jsonb,
  max_participants integer null default 20,
  current_participants integer null default 0,
  is_active boolean null default true,
  created_at timestamp with time zone null default now(),
  updated_at timestamp with time zone null default now(),
  partner_id integer null,
  constraint travel_offers_pkey primary key (id)
) TABLESPACE pg_default;

create trigger update_travel_offers_updated_at BEFORE
update on travel_offers for EACH row
execute FUNCTION update_updated_at_column ();

